func TestSend(t *testing.T) {
	type item struct {
		Id     string                 `json:"id"`
		Source map[string]interface{} `json:"source"`
	}

	m := ffff()
	for {
		for topic, msgStr := range m {
			topic = "Yuki20210714" + topic
			msg_ := []item{}
			err := json.Unmarshal([]byte(msgStr), &msg_)
			if nil != err {
				fmt.Println("topic: ", topic, ", err: ", err)
				continue
			}

			err = Send(topic, msg_, SerializeJson)
			if nil != err {
				fmt.Println("topic: ", topic, ", err: ", err)
			}
			break
		}

		time.Sleep(500 * time.Millisecond)
		fmt.Println("m len: ", len(m))
		break
	}
}

